import React, {Component} from 'react';

class Input extends Component{
    render(){
        return (
            <div class="md-form mb-5">
                <i class="fas fa-user prefix grey-text">{this.props.questions.question}</i>
                <input type={this.props.questions.type} id={"form" + this.props.questions.id} class="form-control validate"/>
                <label data-error="wrong" data-success="right" for="form34"></label>
            </div>
        );
    }
}


export default Input;
